import React from 'react';
import SignInForm from './SignInForm';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: null,
            email: null,
            password: null
        }
    }

    onFormSubmit = (state) => {
        for (const[key, value] of Object.entries(state)) {
            this.setState({
                [key]: value,
            });
        }
        console.log(this.state);
    }

    render() {

        return (
            <div>
                <h1>Hello world</h1>
                <div>
                    <SignInForm onFormSubmit={this.onFormSubmit.bind(this)}/>
                </div>
            </div>
        );
    }
}



export default App;
